import React from "react";

class Welcome extends React.Component {
  render(){
    return (
      <div>
      <h1> Welcome to the Punk Print Registry Store </h1>
      <p>Here you'll be able to purchase authentication for your <a href="https://www.larvalabs.com/cryptopunks">CryptoPunks </a></p>
      <p> You will be transacting directly through the Punk Print Registry Smart Contract.</p>
      </div>
    )
  }
}
export default Welcome;
